  '/photos/wine-night/egirls june 2025-096.jpg',
  '/photos/wine-night/egirls june 2025-097.jpg',
  '/photos/wine-night/egirls june 2025-098.jpg',
  '/photos/wine-night/egirls june 2025-100.jpg',
  '/photos/wine-night/egirls june 2025-101.jpg'
];

// Individual Photo Component
const PhotoItem = ({ photo, index, scrollYProgress, isActive }) => {
  // Randomized scale curves for each image
  const maxScale = 1.0 + Math.random() * 0.2; // 1.0 to 1.2
  const minScale = 0.4 + Math.random() * 0.2; // 0.4 to 0.6

  // Slight vertical offset for collage effect
  const verticalOffset = (Math.random() * 50) - 25; // Â±25px up/down

  // Calculate initial horizontal position (spread across screen)
  const initialX = (index * 350) - (wineNightPhotos.length * 175); // Center the spread

  // Horizontal translation based on scroll progress
  const translateX = useTransform(
    scrollYProgress,
    [0, 1],
    [initialX, initialX - 1000] // Move left as scroll progresses
  );

  // Scale based on horizontal position (center = max scale)
  const scale = useTransform(
    translateX,
    [-200, 0, 200], // Center area
    [minScale, maxScale, minScale] // Scale down, up, down
  );

  // Z-index based on scale for layering
  const zIndex = useTransform(scale, [minScale, maxScale], [1, 100]);

  return (
    <motion.div
      className="photo-item"
      style={{
        translateX,
        translateY: verticalOffset,
        scale,
        zIndex,
        position: 'absolute'
      }}
      initial={{ opacity: 0 }}
      whileInView={{ opacity: 1 }}
      viewport={{ once: true, margin: "-10%" }}
      transition={{ duration: 0.6, ease: "easeOut" }}
    >
      <img 
        src={photo} 
        alt={`Wine night photo ${index + 1}`}
        loading="lazy"
        style={{
          width: '300px',
          height: '400px',
          objectFit: 'cover',
          borderRadius: '8px',
          opacity: 0,
          transition: 'opacity 0.3s ease-in'
        }}
        onLoad={(e) => { e.target.style.opacity = '1'; }}
        onError={(e) => { 
          console.error('Failed to load wine night photo:', photo); 
          e.target.style.opacity = '0.5'; 
        }}
      />
    </motion.div>
  );
};

// Photo Timeline Component
const PhotoTimeline = () => {
  const containerRef = useRef(null);
  const [currentPhotoIndex, setCurrentPhotoIndex] = useState(0);
  const { scrollYProgress } = useScroll({
    target: containerRef,
    offset: ["start start", "end end"]
  });

  // Handle wheel events for both vertical and horizontal scrolling
  const handleWheel = (e) => {
    e.preventDefault();

    // Determine scroll direction and amount
    const deltaX = e.deltaX || 0;
    const deltaY = e.deltaY || 0;

    // Use the larger delta to determine primary scroll direction
    if (Math.abs(deltaX) > Math.abs(deltaY)) {
      // Horizontal scroll
      if (deltaX > 0) {
        // Scroll right - next photo
        setCurrentPhotoIndex(prev => Math.min(prev + 1, wineNightPhotos.length - 1));
      } else {
        // Scroll left - previous photo
        setCurrentPhotoIndex(prev => Math.max(prev - 1, 0));
      }
    } else {
      // Vertical scroll
      if (deltaY > 0) {
        // Scroll down - next photo
        setCurrentPhotoIndex(prev => Math.min(prev + 1, wineNightPhotos.length - 1));
      } else {
        // Scroll up - previous photo
        setCurrentPhotoIndex(prev => Math.max(prev - 1, 0));
      }
    }
  };

  return (
    <div 
      className="photo-timeline-container" 
      ref={containerRef}
      onWheel={handleWheel}
    >
      <div className="photo-timeline">
        {wineNightPhotos.map((photo, index) => (
          <PhotoItem 
            key={index}
            photo={photo}
            index={index}
            scrollYProgress={scrollYProgress}
            isActive={index === currentPhotoIndex}
          />
        ))}
      </div>
    </div>
  );
};

// Digital Collage Component with responsive positioning
const DigitalCollage = () => {
  const containerRef = useRef(null);
  const [hoveredImage, setHoveredImage] = useState(null);
  const [isDragging, setIsDragging] = useState(false);
  const [dragStart, setDragStart] = useState({ x: 0, y: 0 });
  const [dragOffset, setDragOffset] = useState({ x: 0, y: 0 });
  const [loadedImages, setLoadedImages] = useState(new Set());

  // Brand photos array
  const brandPhotos = [
    '/brand/EGIRLS INITIATION ENVELOPE MOCKUP.jpg',
    '/brand/EGIRLS LSD EDIT copy smol.png',
    '/brand/EGIRLS TV WALL MOCKUP.jpg',
    '/brand/EVERYTHING WILL KILL YOU POSTER (1).jpg',
    '/brand/STAGE 2 EGIRLS.jpg',
    '/brand/TRAFFIC LIGHT smol.png',
    '/brand/WhatsApp Image 2025-06-04 at 14.35.32 (3).jpeg',
    '/brand/WhatsApp Image 2025-06-04 at 14.35.32 (4).jpeg',
    '/brand/WhatsApp Image 2025-06-04 at 14.35.32 (5).jpeg',
    '/brand/WhatsApp Image 2025-06-05 at 22.42.36.jpeg',
    '/brand/WhatsApp Image 2025-06-10 at 18.02.52 (1).jpeg',
    '/brand/WhatsApp Image 2025-06-11 at 13.10.45 (1).jpeg',
    '/brand/WhatsApp Image 2025-06-11 at 14.23.40 (3).jpeg',
    '/brand/WhatsApp Image 2025-06-11 at 14.23.41 (1).jpeg',
    '/brand/WhatsApp Image 2025-06-12 at 23.17.49 (2).jpeg',
    '/brand/WhatsApp Image 2025-06-12 at 23.17.50 (1).jpeg',
    '/brand/WhatsApp Image 2025-06-12 at 23.17.50 (2).jpeg',
    '/brand/WhatsApp Image 2025-08-20 at 15.04.27.jpeg',
    '/brand/billboard.jpg',
    '/brand/cd-case.jpg',
    '/brand/floppy-disk.jpg',
    '/brand/window-poster.jpg'
  ];

  // Add window resize listener for responsive positioning
  const [windowSize, setWindowSize] = useState({
    width: window.innerWidth,
    height: window.innerHeight
  });

  useEffect(() => {
    const handleResize = () => {
      setWindowSize({
        width: window.innerWidth,
        height: window.innerHeight
      });
    };

    // Handle mobile viewport height changes (address bar show/hide)
    const handleViewportChange = () => {
      const vh = window.innerHeight * 0.01;
      document.documentElement.style.setProperty('--vh', `${vh}px`);

      setWindowSize({
        width: window.innerWidth,
        height: window.innerHeight
      });
    };

    window.addEventListener('resize', handleResize);
    window.addEventListener('orientationchange', handleViewportChange);

    // Initial viewport height calculation
    handleViewportChange();

    return () => {
      window.removeEventListener('resize', handleResize);
      window.removeEventListener('orientationchange', handleViewportChange);
    };
  }, []);

  // Mobile photo stack state
  const [photoStack, setPhotoStack] = useState([...brandPhotos]);
  const [swipeStart, setSwipeStart] = useState({ x: 0, y: 0 });
  const [isSwiping, setIsSwiping] = useState(false);

  // Responsive image positioning based on screen size
  const imageStyles = useMemo(() => {
    const isMobile = windowSize.width <= 768;
    const isSmallMobile = windowSize.width <= 480;
    const isTinyMobile = windowSize.width <= 360;

    // Responsive dimensions
    let imageWidth, imageHeight;
    if (isTinyMobile) {
      imageWidth = 80;
      imageHeight = 60;
    } else if (isSmallMobile) {
      imageWidth = 120;
      imageHeight = 90;
    } else if (isMobile) {
      imageWidth = 200;
      imageHeight = 150;
    } else {
      imageWidth = 400;
      imageHeight = 300;
    }

    const padding = isMobile ? 15 : 25;
    const headerHeight = 45;
    const footerHeight = 120;
    const safeHeight = windowSize.height - headerHeight - footerHeight;
    const availableWidth = windowSize.width - (padding * 2);
    const availableHeight = safeHeight - (padding * 2);

    console.log('Positioning calculation:', {
      isMobile,
      windowSize,
      imageWidth,
      imageHeight,
      availableWidth,
      availableHeight,
      padding
    });

    return photoStack.map((_, index) => {
      let posX, posY;

      if (isMobile) {
        // Mobile: Stack photos on top of each other with slight offsets
        const centerX = windowSize.width / 2;
        const centerY = headerHeight + (safeHeight / 2);

        // Create a stacked effect with slight random offsets
        const stackOffset = index * 2; // Small offset for each layer
        const randomOffsetX = (Math.random() - 0.5) * 40; // Random horizontal offset
        const randomOffsetY = (Math.random() - 0.5) * 40; // Random vertical offset

        posX = centerX - (imageWidth / 2) + randomOffsetX + stackOffset;
        posY = centerY - (imageHeight / 2) + randomOffsetY + stackOffset;

        // Ensure we don't go outside bounds
        posX = Math.max(padding, Math.min(windowSize.width - imageWidth - padding, posX));
        posY = Math.max(headerHeight + padding, Math.min(windowSize.height - footerHeight - imageHeight - padding, posY));
      } else {
        // Desktop: Center clustering
        const centerX = windowSize.width / 2;
        const centerY = headerHeight + (safeHeight / 2);
        const clusterWidth = availableWidth * 0.7;
        const clusterHeight = availableHeight * 0.7;

        posX = centerX - (clusterWidth / 2) + (Math.random() * clusterWidth) - (imageWidth / 2);
        posY = centerY - (clusterHeight / 2) + (Math.random() * clusterHeight) - (imageHeight / 2);

        // Clamp to viewport
        posX = Math.max(padding, Math.min(windowSize.width - imageWidth - padding, posX));
        posY = Math.max(headerHeight + padding, Math.min(windowSize.height - footerHeight - imageHeight - padding, posY));
      }

      // Debug logging for first few images
      if (index < 5) {
        console.log(`Image ${index}: posX=${posX}, posY=${posY}, isMobile=${isMobile}, stackIndex=${index}`);
      }

      return {
        position: 'absolute',
        left: `${posX + dragOffset.x}px`,
        top: `${posY + dragOffset.y}px`,
        transform: `rotate(${(Math.random() - 0.5) * 30}deg)`,
        zIndex: index,
        opacity: 1,
        transition: isDragging ? 'none' : 'transform 0.3s ease-out'
      };
    });
  }, [photoStack, dragOffset.x, dragOffset.y, isDragging, windowSize]);

  // Mouse and touch event handlers
  const handleMouseDown = (e) => {
    if (e.button === 0) {
      setIsDragging(true);
      setDragStart({ x: e.clientX - dragOffset.x, y: e.clientY - dragOffset.y });
    }
  };

  const handleMouseMove = (e) => {
    if (isDragging) {
      setDragOffset({
        x: e.clientX - dragStart.x,
        y: e.clientY - dragStart.y
      });
    }
  };

  const handleMouseUp = () => {
    setIsDragging(false);
  };

  const handleTouchStart = (e) => {
    if (e.touches.length === 1) {
      const touch = e.touches[0];
      setSwipeStart({ x: touch.clientX, y: touch.clientY });
      setIsSwiping(true);

      // For dragging functionality
      setIsDragging(true);
      setDragStart({
        x: touch.clientX - dragOffset.x,
        y: touch.clientY - dragOffset.y
      });
    }
  };

  const handleTouchMove = (e) => {
    if (e.touches.length === 1) {
      const touch = e.touches[0];

      if (isDragging) {
        e.preventDefault();
        setDragOffset({
          x: touch.clientX - dragStart.x,
          y: touch.clientY - dragStart.y
        });
      }
    }
  };

  const handleTouchEnd = (e) => {
    if (isSwiping && windowSize.width <= 768) {
      const touch = e.changedTouches[0];
      const deltaX = touch.clientX - swipeStart.x;
      const deltaY = touch.clientY - swipeStart.y;

      // Check if it's a horizontal swipe (more horizontal than vertical)
      if (Math.abs(deltaX) > Math.abs(deltaY) && Math.abs(deltaX) > 50) {
        // Swipe left or right - cycle through photos
        if (deltaX > 0) {
          // Swipe right - move first photo to back
          setPhotoStack(prev => {
            const newStack = [...prev];
            const firstPhoto = newStack.shift();
            newStack.push(firstPhoto);
            return newStack;
          });
        } else {
          // Swipe left - move last photo to front
          setPhotoStack(prev => {
            const newStack = [...prev];
            const lastPhoto = newStack.pop();
            newStack.unshift(lastPhoto);
            return newStack;
          });
        }
      }
    }

    setIsSwiping(false);
    setIsDragging(false);
  };

  // Remove Intersection Observer since we're loading all images immediately

  // Debug logging
  console.log('DigitalCollage rendering:', {
    brandPhotosCount: brandPhotos.length,
    windowSize,
    imageStyles: imageStyles.length
  });

  return (
    <div
      className="digital-collage-container"
      ref={containerRef}
      onMouseDown={handleMouseDown}
      onMouseMove={handleMouseMove}
      onMouseUp={handleMouseUp}
      onMouseLeave={handleMouseUp}
      onTouchStart={handleTouchStart}
      onTouchMove={handleTouchMove}
      onTouchEnd={handleTouchEnd}
      style={{ cursor: isDragging ? 'grabbing' : 'grab' }}
    >
      {brandPhotos.map((photo, index) => (
        <div
          key={index}
          className={`collage-image ${hoveredImage === index ? 'hovered' : ''} ${index === 0 ? 'top-photo' : ''}`}
          style={imageStyles[index]}
          onMouseEnter={() => setHoveredImage(index)}
          onMouseLeave={() => setHoveredImage(null)}
        >
          <img
            src={encodeURI(photo)}
            alt={`Brand asset ${index + 1}`}
            draggable="false"
            loading="lazy"
            onMouseEnter={() => setHoveredImage(index)}
            onMouseLeave={() => setHoveredImage(null)}
            style={{
              opacity: loadedImages.has(index) ? 1 : 0,
              transition: 'opacity 0.3s ease-in',
              width: '100%',
              height: '100%',
              objectFit: 'contain'
            }}
            onLoad={(e) => {
              console.log(`Image ${index} loaded successfully:`, photo);
              setLoadedImages(prev => new Set([...prev, index]));
              e.target.style.opacity = '1';
            }}
            onError={(e) => {
              console.error(`Failed to load image ${index}:`, photo);
              e.target.style.opacity = '0.5';
              e.target.style.border = '2px solid red';
            }}
          />
        </div>
      ))}
    </div>
  );
};

// Draggable Folder Component
const DraggableFolder = ({ name, initialX, initialY, onOpen }) => {
  const [position, setPosition] = useState({ x: initialX, y: initialY });
  const [isDragging, setIsDragging] = useState(false);
  const [dragStart, setDragStart] = useState({ x: 0, y: 0 });

  const handleMouseDown = (e) => {
    e.preventDefault();
    setIsDragging(true);
    setDragStart({
      x: e.clientX - position.x,
      y: e.clientY - position.y
    });
  };

  const handleMouseMove = (e) => {
    if (isDragging) {
      setPosition({
        x: e.clientX - dragStart.x,
        y: e.clientY - dragStart.y
      });
    }
  };

  const handleMouseUp = (e) => {
    // Check if we actually moved the folder
    const movedDistance = Math.sqrt(
      Math.pow(e.clientX - (dragStart.x + position.x), 2) + 
      Math.pow(e.clientY - (dragStart.y + position.y), 2)
    );

    // If moved more than 5px, consider it a drag, not a click
    if (movedDistance > 5) {
      setIsDragging(false);
      // Prevent click event by setting a flag
      e.target.dataset.wasDragged = 'true';
    } else {
      setIsDragging(false);
    }
  };

  const handleClick = (e) => {
    // Only open folder if it wasn't dragged
    if (!isDragging && e.target.dataset.wasDragged !== 'true') {
      onOpen(name);
    }
    // Reset the flag
    delete e.target.dataset.wasDragged;
  };

  useEffect(() => {
    if (isDragging) {
      document.addEventListener('mousemove', handleMouseMove);
      document.addEventListener('mouseup', handleMouseUp);
      return () => {
        document.removeEventListener('mousemove', handleMouseMove);
        document.removeEventListener('mouseup', handleMouseUp);
      };
    }
  }, [isDragging, dragStart]);

  return (
    <div
      className="draggable-folder"
      style={{
        position: 'absolute',
        left: position.x,
        top: position.y,
        cursor: isDragging ? 'grabbing' : 'grab'
      }}
      onMouseDown={handleMouseDown}
      onClick={handleClick}
    >
      <img src="/macOSfolder.png" alt="folder" className="folder-icon" />
      <span className="folder-name">{name}</span>
    </div>
  );
};

